import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const Name = styled.h1`
  font-family: 'Abril Fatface', cursive;
  font-size: 2.5em;
`

const ProfileDetail = styled.p`
  margin-bottom: 0;
`

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  display: inline-block;
  vertical-align: top;
`

class Profile extends Component {
  render() {
    return (
      <React.Fragment>
        <ProfileWrapper>
          <Name>
            Punchaya
            <br /> Siriphanthong
          </Name>
          <p>Birdthday: 26 December 1996</p>
          <p>p.siriphanthong@gmail.com</p>
          {/* <p>การบ้าน</p>
          <p>
            Welcome, my name is Punchaya Siriphanthong. <br />
            My girlfriend is Pattarawadee Tamthinthai. I love her so much. :)
          </p> */}
        </ProfileWrapper>
        <ExperinceWrapper>
          <p>Assumption Collect Ubonratchathani</p>
          <p>King's Mongkut University</p>
        </ExperinceWrapper>
      </React.Fragment>
    )
  }
}

export default Profile
